# https://leetcode.com/problems/longest-substring-without-repeating-characters/

class Solution(object):
    def lengthOfLongestSubstring(self,s):
        """
        :type s: str
        :rtype: int
        """

        longest_len = 0
        for a in range(0,len(s)):
            list = []
            list.append(s[a])

            for b in range(a+1,len(s)):
                if not s[b] in list:
                    list.append(s[b])
                    print(list)
                else: break

            if len(list) > longest_len:
                longest_len = len(list)

        return longest_len


    def betterLengthOfLongestSubstring(self, s):
        longest_len = 0
        a = 0
        if len(s) == 1:
            longest_len = 1
        else:
            while a < len(s)-1:
                list = []
                list.append(s[a])
                a = a+1
                for b in range(a,len(s)):
                    if not s[b] in list:
                        list.append(s[b])
                        # print(list)
                    else:
                        a = a + list.index(s[b])
                        # print(a)
                        break
                if len(list) > longest_len:
                    longest_len = len(list)

        return longest_len


